import React from "react";
export default function(){
    return(
        <div>
            <div id = "about">
                <h3>About</h3>
                <p>PES University RR Campus B.Tech CSE.
                Frontend developer . Know React,Angular and Vue.Know a bit of Machine Learning and C++.</p>
            </div>
            <div id = "about">
                <h3>Interests</h3>
                <p>Interests are coding</p>
            </div>
        </div>
    )
}
